void Initialize() {
  for (size_t i = 0; i < kNumSigns; ++i) {
    indices_[i] = i;
  }
  Shuffle();
  initialized_ = true;
}

const RleImage* Next() {
  if (!initialized_) {
    Initialize();
  }

  size_t idx = indices_[current_idx_++];
  if (current_idx_ >= kNumSigns) {
    Shuffle();
  }

  return kTable[idx];
}

void decode_rle_row_1bpp(
    const RleImage& img,
    uint16_t y,
    uint8_t* row_data,
    uint16_t row_bytes) {
  memset(row_data, 0x00, row_bytes);
  if (y >= img.h) {
    return;
  }

  const uint8_t* p = img.data + img.row_offs[y];
  uint16_t x = 0;

  while (x < img.w) {
    uint8_t t = *p++;
    bool black = (t & 0x80) != 0;
    uint8_t run = t & 0x7F;

    if (black) {
      for (uint8_t i = 0; i < run && x < img.w; ++i, ++x) {
        row_data[x >> 3] |= (0x80 >> (x & 7));
      }
    } else {
      x += run;
    }
  }
}

